import React from 'react'
import fexportada from '../../store/prueba/reducer'
import {lePinchoElCarnal} from '../../store/prueba/action'
import { connect } from 'react-redux'

const Prueba = ({lePinchoElCarnal}) =>{

    return(
        <div>
            <button onClick={({interruptor})=>lePinchoElCarnal(interruptor)}>Pinchale aqui carnal!!</button>
        </div>
    )
}
const mapStateToProps = (state)=>{
    return{
        interruptor: fexportada(state)
    }
}
export default connect(null, {lePinchoElCarnal})(Prueba)
